import React, {Component} from "react";
import {
  Route,
  NavLink,
  BrowserRouter
} from "react-router-dom";

import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

import SearchPage from "./SearchPage.js";

class Main extends Component{
  render(){
    return(
      <BrowserRouter>
        <Navbar bg="light" expand="lg" sticky="top">
          <Navbar.Brand><NavLink className="" exact to="/">Home</NavLink></Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
              <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="mr-auto">
                <Nav.Link ><NavLink className="" to="">Projects</NavLink></Nav.Link>
                <Nav.Link ><NavLink className="" to="">Resume</NavLink></Nav.Link>
                <Nav.Link ><NavLink className="" to="">Contact</NavLink></Nav.Link>
                </Nav>
              </Navbar.Collapse>
        </Navbar>

        <Route exact path="/" component={SearchPage}/>

      </BrowserRouter>
    )
  }
};

export default Main;
